import React from 'react'
import CheckBoxComponent from './CheckBoxComponent'

export default function FilterCategoryComponent({value}) {
  return (
    <div>
      <span>{value}</span>
        <CheckBoxComponent value="All"/>
        <CheckBoxComponent value="Male"/>
        <CheckBoxComponent value="Female"/>
        <CheckBoxComponent value="Transgender"/>
    </div>
  )
}
